import Home from "../pages/user/Home";
import Login from "../pages/user/Login";

const pulicRouter = [
    {
        path: "/", component: Home
    },
    {
        path: "/login", component: Login
    },
    {
        path: "/admin", component: Login
    }
]

const privateRouters = [];

export {pulicRouter, privateRouters};
